import "./promo.css";

 

const Promo = () => {

 
  return (
    <section id="home" class="promo-section">

    <div class="container">
        <div class="promo-content">
            <h1>KANIN ROMAN</h1>
            <h2><span class="rotate">E N G I N E E R / D E V E L O P E R </span></h2 >
            <p> Делаю вещи и заставляю их работать.
               Воплощая ваши мечты в реальность.</p>
               
               <ul class="social-link">
                
                
                <li><a href="#"><i class="fa fa-instagram"></i></a></li>
                <li><a href="#"><i class="fa fa-youtube"></i></a></li>
                <li><a href="#"><i class="fa fa-github "></i></a></li>
                <li><a href="#"><i class="fa fa-code "></i></a></li>
                
            </ul>
        </div>
    </div>
    <div class="down-arrow">
        <a data-scroll href="#about" class="arrow-animated">Scroll Down <i class="ti-arrow-down"></i></a>
    </div>
</section>
  );
};

export default Promo;
